from sympy import divisors, isprime
def f(n): return int("".join(str(d) for d in divisors(n)[1:-1]))
def a(n):
    if n == 0: return 1
    fn, c = 2*n + 1, 0
    while not isprime(fn):
        fn, c = f(fn), c+1
    return fn
print([a(n) for n in range(22)]) # _Michael S. Branicky_, Jul 11 2022

